import { useParams } from 'react-router-dom';
import { Guitars } from '../../types/guitar';


type GuitarFullProps = {
    guitars: Guitars;
  };

function GuitarFull({guitars} : GuitarFullProps): JSX.Element {
  const {id} = useParams();
  const requiredGuitar = guitars.find((guitar) => guitar.id === id);


}
